import { tableHead, tableRow } from "../constant/constent"

const RecentOrders = () => {
    return (
        <div>
            <div className='flex p-3 items-center justify-between border-b-[1px] border-[#0E253C1A]'>
                <p className='text-black_200 font-semibold text-[18px]'>Recent Orders</p>
            </div>
            <table className="w-full">
                <thead className="bg-white text-[#0E253CD9] py-4 text-[12px] font-medium border-b-[1px] border-[#0E253C1A]">
                    <tr>
                        {
                            tableHead.map((head) => {
                                return (
                                    <th><p className="p-2 text-[12px] font-medium">{head}</p></th>
                                )
                            })
                        }
                    </tr>
                </thead>
                <tbody>
                    {
                        tableRow.map((row, index) => {
                            return (
                                <tr key={index} className="!p-4 border-b-[1px] border-[#0E253C1A]">
                                    <td className="text-center">
                                        <p className="text-[14px] font-normal">{row.id}</p>
                                    </td>
                                    <td className="text-center">
                                        <div className="flex items-center justify-start">
                                            x{index + 1}  <img src={`images/${row.pImg}`} alt='disk' />
                                            <p className="text-[14px] font-normal">{row.product}</p>
                                        </div>
                                    </td>
                                    <td className="text-center"><img src={`images/${row.customer}`} alt='disk' /></td>
                                    <td className="text-center">
                                        <div className="flex items-center justify-start gap-2">
                                            <img src={`images/${row.cImg}`} className="w-6 h-6" alt='channel' />
                                            <p className="text-[14px] font-normal">{row.channel}</p>
                                        </div>
                                    </td>
                                    <td className="text-center"><p className="text-[14px] font-normal">{row.total}</p></td>
                                    <td className="text-center"><p className="text-[14px] font-normal">{row.date}</p></td>
                                </tr>
                            )
                        })
                    }
                </tbody>
            </table>
        </div>
    )
}

export default RecentOrders
